import { createAsyncThunk, createSlice } from "@reduxjs/toolkit";
import axios from "axios";

const fetchStockData = createAsyncThunk(
  "information/fetchStockData",
  async () => {
    const response = await axios.get(this.url);
    return response.data.data;
  }
);

const itemSlice = createSlice({
  name: "items",
  initialState: {
    item: [],
  },
  reducers: {},
  extraReducers: builder => {
    builder.addCase(fetchStockData.fulfilled,(state, action) => {
        const responeData = [];
        action.payload.forEach(item => {
            responeData.push(item);
        })
        console.log(12323);
    })
  },
});

export const getStockList = itemSlice.actions;
export default itemSlice.reducer;
export const selectItems = (state: any) => state.items.item;
